import React from "react";
import Contacts from "../contacts.js";

var con = Contacts;
function Card(props) {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <div className="card">
        <div className="top">
          <h2>{props.name}</h2>
          <img src={props.img} alt="avatar_img" />
        </div>
        <div className="bottom">
          <p>{props.phone}</p>
          <p>{props.email}</p>
        </div>
      </div>
    </div>
  );
}

function App() {
  return (
    <Card
      name={con[0].name}
      phone={con[0].phone}
      img={con[0].imgURL}
      email={con[0].email}
    />
  );
}

export default App;
